import React from "react";

function Home() {
  return (
    <div>
      <button
        className="btn btn-success"
        onClick={() => setToast((toast) => !toast)}
      >
        Toast {toast ? "hide" : "show"}
      </button>
    </div>
  );
}

export default Home;
